INSERT INTO `AppInstance` VALUES ('1.0.1','360电视助手—是android智能电视的资源获取平台。提供海量的游戏、软件、音乐、视频、图片，通过它轻松下载、安装、管理资源。所有提供信息资源，全部经过360安全检测中心的审核认证，绿色无毒，安全无忧。360电视助手，为智能电视而生！','2014-05-08 02:42:43','com.qihoo.tvstore.apk',1716533,2,10,14,0,'360电视助手','','','com.qihoo.tvstore',1,NULL,1,0,1,NULL,NULL,'360dszs',0,3),('1.0.0','《悟空识字》是一款专门为3-8岁学龄前及一年级儿童开发的识字软件。整套软件包括1200个最常用汉字、1200个句子和5000个词语，结合儿童熟悉的《西游记》经典场景，让儿童在游戏中快乐地认识汉字。','2014-05-08 02:42:43','air.com.gongfubb.wksz.tv.apk',10557368,1000000,8,17,0,'悟空识字','','','air.com.gongfubb.wksz.tv',1,NULL,2,82,1,NULL,NULL,'wksz',0,3),('1.6.2','国内最受欢迎的旅行类应用，空管总局独家数据支持。提供航班延误查询和国内机票查询的出行服务。 \n\n特色服务： \n1.航班延误查询--空管总局独家数据支持 \n2.航空公司直销票--靠谱低价有保障 \n3.超值头等舱--经济舱的价格，头等舱的服务','2014-05-08 02:42:43','com.flightmanager.tv.apk',3217303,20,14,0,0,'航班管家','Flight Manager','优化了部分界面 \n修复了部分bug \n适配兼容了Android 4.3和4.4','com.flightmanager.tv',1,NULL,3,1484,1,NULL,NULL,'hbgj',0,3),('1.0','新闻？实用？乐趣？有声资讯TV版，给你不一样的新闻体验...更多精彩等你来发现。','2014-05-08 02:42:43','com.dt.news.tv.mobile.apk',1585629,1,14,0,0,'有声资讯','','','com.dt.news.tv.mobile',1,NULL,4,0,1,NULL,NULL,'yszx',0,3),('v 2.1.0','网趣云加速为海外华人专用网络加速系统，中国大陆用户无法使用。通过部署在北美、欧洲、亚洲、多组云加速服务器，结合运用最先进的互联网技术向海外用户提供最稳定的加速服务。\n海外用户在观看优酷、爱奇异、乐视、搜狐视频、腾讯视频等国内知名视频网站时，经常现很多视频受用户所在地域限制无法观看，或是在线播放视频经常出现卡顿。在安卓机顶盒、手机、平板上使用网趣云加速后，即可享受极致的观看体验，免除受限和卡顿的烦恼。使旅居海外的华人可即時观看到大陆最热播电影、电视剧等和中文电视直播，在母语环境中放松身心，找到归属感！','2014-05-08 02:42:43','com.swkj.speed.apk',5241392,6,8,15,0,'网趣云加速','speed','新增对触控设备支持\n增加软件到期提示\n增加私信通知功能','com.swkj.speed',1,NULL,5,77,1,NULL,NULL,'wqyjs',0,1),('2.03','\"K客\"是专为喜爱K歌的朋友们开发的一款K歌应用，该应用采用了绚丽的海洋风格操作界面，配置专业的智能K歌评分系统，集成了实时录音，微博分享，原唱切换，海量正版歌曲下载等特色功能，让你随时随地享受卡拉OK带来的乐趣。','2014-05-08 02:42:43','com.multak.LoudSpeakerKaraoke.apk',24529218,203,9,0,0,'K客','','菜单结构全新优化，点歌唱歌更便捷；\n高品质歌曲上线；\n手机点歌工具“K客助手”上线；\n支持自定义歌曲扩充；\n上传歌曲二维码分享;\n取消一分钟播放限制。','com.multak.LoudSpeakerKaraoke',1,NULL,6,116,1,NULL,NULL,'kk',0,3),('1.0.0','图钉是一款基于位置的影像分享社区应用。来自全球各地喜欢拍摄的钉友们每天都在用照片和视频分享着生活精彩瞬间。美女、帅哥、萌宠、小宝贝、旅行、美食、宠物、搞笑，各种好看好玩，就在图钉！','2014-05-08 02:42:43','com.gypsii.tuding_tv.apk',1144777,1,14,19,0,'图钉社区','','','com.gypsii.tuding_tv',1,NULL,7,0,1,NULL,NULL,'tdsq',0,4),('1.0.1','熊猫拼音是“熊猫乐园”专门为小朋友精心设计的互动类儿童学拼音软件，软件从儿童喜爱卡通动画游戏兴趣入手，带宝宝进入神秘刺激的拼音寻宝世界，在看动画、玩游戏的互动过程中不知不觉地学会拼音。在整个拼音学习寻宝的过程中，将过关、闯阵、挑战等30多组益智探险游戏完美融合，比如凶猛的大鲨鱼、激流漩涡、大蜘蛛等，你需要开动脑筋，想办法来克服这些，当你顺利战胜这些困难，最后就能开启神秘的宝藏。','2014-05-08 02:42:43','air.common.pinyin.tv.android.A123qibu.com.apk',10389912,1000001,8,17,0,'熊猫拼音','','优化网络加载，采用全网CDN冗错加载\n增加拼读模块，加强拼音学习效果\n优化键盘输入支持','air.common.pinyin.tv.android.A123qibu.com',1,NULL,8,150,1,NULL,NULL,'xmpy',0,3),('1.0.1','熊猫乐园是为2-10岁小朋友开发的儿童学习乐园，由熊猫乐园倾力打造的熊猫乐园诗词，包括上百首古代诗词当中比较热门、受广大小朋友和家长所喜爱的经典诗词。熊猫乐园诗词中的每首都是精心打造，全新的视觉体验，不一样的画面场景，让您有不一样的视听感受。诗词中蕴含着丰富的人文景观和人生哲理，是帮助孩子们认识大自然、了解世界的媒介之一。让宝宝们在轻松、快乐、自然的状态下学习古诗，真的做到熟读唐诗三百首，不会作诗也会吟。','2014-05-08 02:42:44','air.poem.tv.android.A123qibu.com.apk',10359437,1000001,8,17,0,'熊猫乐园诗词','','优化网络加载，采用全网CDN冗错加载','air.poem.tv.android.A123qibu.com',1,NULL,9,150,1,NULL,NULL,'xmlysc',0,4),('1.1.0','这里有最冷最全最新潮的笑话！\n让你从此告别讲笑话而冷场的尴尬，成为活跃气氛的笑话高手！\n还有更多爆笑图片、雷人囧事、恶搞网文、奇闻趣事……\n戳爆你的笑点！让你捧腹大笑！\n每日编辑推荐更新海量数据，让你网罗天下新鲜事！\n放松心情，轻松解压，居家旅行、开心必备！\n绝对是你等公交等地铁打发无聊时光不二之选！\n错过这个店就没那个店小二了！\n赶紧点下载按钮吧！更多欢乐等着你哟~\n','2014-05-08 02:42:44','com.coldworks.coldjoke_letv.apk',1622650,2,14,17,0,'爱讲冷笑话','coldjokes','','com.coldworks.coldjoke_letv',1,NULL,10,296,1,NULL,NULL,'ajlxh',0,4),('1.0.1','      咕力咕力儿童早教，是由亲宝儿童教育研发中心专为0-6岁儿童打造的儿童行为养成教育动画品牌，通过每集2-3分钟的有趣故事，帮助妈妈一点一滴改变孩子的行为习惯。百度搜索“咕力咕力”了解更多。\n      故事背景：在很久很久之前，大海中间有一座小岛。岛上茂密的森林里居住着相亲相爱的咕力咕力家族。它们快乐、阳光、爱学习、热情开朗、充满爱心……在这个神奇的小岛上，每天都在上演着有趣的小故事。尤其是黄咕力、蓝咕力、红咕力、绿咕力、粉咕力，它们好玩的故事太多太多了，可以绕地球好几圈呢。 让我们一起来走进可爱的咕力世界吧！','2014-05-08 02:42:44','com.iqinbao.android.gulitv.apk',12869513,2,10,0,0,'咕力咕力幼教','','','com.iqinbao.android.gulitv',1,NULL,11,162,1,NULL,NULL,'glglyj',0,2),('1.9.0','鲜果联播HD版是鲜果网(XianGuo.com)针对Android平板推出的一款免费阅读应用，杂志般的阅读体验，内容丰富， 功能强大。\n支持Android 2.2及以上版本、屏幕分辨率大于480×800。杂志般的阅读体验，内容丰富， 功能强大。 既可以从数百万名人博客、各大新闻网站、知名报刊杂志中订阅自己喜欢的内容，还可以用新浪微博账号实时追踪好友动态、了解热点快讯。','2014-05-08 02:42:48','com.xianguo.tv.apk',2