易！ 补充: 这是SEGA世嘉公司在N年前 的1989年制作的著名动作游戏， 《战斧》，其神秘的冒险气氛吸引了 众多的玩家，流畅的画面及主角气势 磅礴的魔法让人流连忘返。 共有三个角色可选，男主人公是 个各项技能平均的角色；女主人公攻 击力稍弱，魔法最强；老人的魔法最 弱，但武功最强，《战斧》就是取名 于他手中的黄金武器。 本作最具杀伤力的必杀技是三人 共有的“穿心斩”，方法是：快速向 前两次，角色就会跑起来，这时按跳 ，在空中下拉方向杆并按住发射键。变成了骨头龙？！ BOSS阿德武功高强，他手中的狮 面盾牌可以吸掉你的魔法；值得一提 的是新加入的一个拿着叉子的金发小 子，他的魔法居然是变出一堆果子？ 用这种方法来补充血格可是新招。','2014-05-08 02:46:58','com.seleuco.goldnaxe.apk',9301352,90000083,7,11,0,'战斧','','','com.seleuco.goldnaxe',1,NULL,105,3,1,NULL,NULL,'zf',0,2),('1.0','基本介绍\n赤色要塞与魂斗罗、绿色兵团、沙罗曼蛇并誉为“四强”，风靡整个八十年代，为诸多80前玩家们所津津乐道。游戏难度不低。\n情节介绍\n你的战友被关押在敌方战线，你是他们重获自由的唯一希望。然而，要解救他们，你要面对的火力非常密集。解救敌方大楼里关押的战俘！你需要用孤狼般的凶猛（the ferocity of a wild Jackal）来创造奇迹！解救人质的勇士有：Decker上校、Bob中尉、Quint军士、Grey下士。这是一场让你热血沸腾的战斗！此游戏\n不光在红白机平台，在后来的街机平台上也推出了更新的版本，游戏难度更为加大。','2014-05-08 02:46:58','com.jimu.emu.nes.jackal.box.apk',3462084,1,11,19,0,'赤色要塞','','','com.jimu.emu.nes.jackal.box',1,NULL,106,0,1,NULL,NULL,'csys',0,3),('1.0','吃豆人是电子游戏历史上的经典街机游戏，由Namco公司的岩谷彻设计并由Midway Games在1980年发行。Pac-Man被认为是80年代最经典的街机游戏之一，游戏的主角小精灵的形象甚至被作为一种大众文化符号，或是此产业的代表形象。它的开发商Namco也把这个形象作为其吉祥物和公司的标帜，一直沿用至今。\n吃豆人游戏\n该游戏的背景以黑色为主。画面中，“Google”6个字母组成回廊似的迷宫画面，四个颜色分别为红、黄、蓝、绿的鬼面符号在迷宫中穿梭，似乎在寻找一个半开半合的黄色圆圈符号。当记者按动键盘上的方位键时，发现该黄色圆圈符号可以行走，并且可以吞吃迷宫路径上的小黄豆，但遇到鬼面符号时就要被吃掉。\n1980年5月22日，日本的南梦宫株式会社（NAMCO）首次在街机平台发布了《吃豆人》。不久之后，美国的Midway公司取得了北美地区的代理权。当时市面的游戏多以《太空侵略者》（Space Invaders》等射击游戏为主，《吃豆人》如同清爽舒适的凉风，很快赢得了包括女性和儿童在内各个层次的玩家的喜爱。从此《吃豆人》一发而不可收拾，销售额屡创新高，周边产品层出不穷。\n吃豆人的造型从吃掉一角的披萨演化而来，不过制作人岩谷彻在1986年接受采访时表示，日语的“口”字也是他的灵感来源——这又是一个通过游戏输出本国文化的典型特例，尽管日语的书写系统来自汉语。\nPac-Man最早的艺名叫Pakkuman，源于“パクパク食べる”的发音paku-paku taberu，paku-paku表示嘴巴一张一合的动作和声音，形象描绘了“我吃，故我在”的生活态度。为了迎合年轻人的口味，Pakkuman被更名为Puckman。但是Puck和某不雅词汇仅有一字之差，于是再作改动，便有了流芳百世的Pac-Man。\n《吃豆人》是易学难精的典型：控制吃豆人吃掉迷宫里面的所有豆子，同时尽可能躲避小鬼怪。一旦吃豆人吃掉能量药丸，它就可以在一定时间内反过来欺负小鬼怪了。特别值得一提的是，迷宫的左右出口是相通的，灵活应用往往带来柳暗花明的奇效。\n【设计者】日本电子游戏商Namco的游戏制作人岩谷彻。\n【意念来源】1979年某天，岩谷彻拿起了面前的一块薄饼正大口咬下，突然他低头注视缺了一角的Pizza，这个却角的薄饼成为了Pac-Man的原型。','2014-05-08 02:47:00','com.jimu.emu.nes.pacman.box.apk',2172958,1,11,19,0,'吃豆人','','','com.jimu.emu.nes.pacman.box'