士、Grey下士。这是一场让你热血沸腾的战斗！此游戏\n不光在红白机平台，在后来的街机平台上也推出了更新的版本，游戏难度更为加大。','2014-05-08 03:01:30','com.seleuco.jackal.apk',8165874,90000083,7,11,0,'赤色要塞','','','com.seleuco.jackal',1,NULL,303,3,1,NULL,NULL,'csys',0,3),('1.0.0.1','此版本为内测版，仅支持部分机型，请谨慎下载使用！','2014-05-08 03:01:30','com.xunlei.xunleitv.apk',7792312,1,9,9,0,'迅雷TV测试版','','','com.xunlei.xunleitv',1,NULL,304,0,1,NULL,NULL,'xltvcsb',0,1),('2.2.9','电视家TV浏览器，可以让大家在盒子或电视上用遥控器非常方便的浏览各类网站，同时针对遥控器和大屏幕的特点，对电视直播、体育直播、视频、各家新闻、最美图片等内容做了聚合和页面转换，是非常适用于电视和盒子用户使用的第一个真正的TV专用浏览器。','2014-05-08 03:01:31','com.android.tvbrowser.apk',1071388,18,14,0,0,'TV浏览器','TV Browser','增加取消收藏功能\n增加清空播放记录的功能\n优化视频播放的快进快退逻辑，用户在播放的过程中快进，体验更好。','com.android.tvbrowser',1,NULL,305,99,1,NULL,NULL,'tvllq',0,3),('1.1','       风靡2014年初的自虐游戏登陆电视平台啦！追逐开始！在最惊险的动作飞行冒险中扑扇起笨拙小鸟的翅膀！ 这里有倒霉的笨拙小鸟等着你的帮助！你的任务就是，指引这些可爱的小鸟飞翔穿梭过各种各样的障碍，最终取回他们的蛋。不过，看似简单的规则下是让人抓狂的游戏难度。\n       本作没有任何关卡的限制，玩家能做得就是靠自己的努力无限闯树桩，每通过一根树桩，头上就会有数字来提醒你通过的是第几根，小编目前的最高成绩是13根树桩，各位高手们可以来试试自己能闯多少。游戏是一个循环模式，如果中途碰到树桩牺牲了，那么就只能重头开始，想要复活接着来，门都没有。所以本作也考验玩家的稳重能力，无法重来的人生，每一步都要坚定而认真的去走。\n　　这款作品在操作上可以说是非常的简单，简单到了让人感觉到蛋疼的地步，玩家在游戏中需要不停的点击手柄或遥控器的任意键来让小鸟飞行，如果不点或者按住按键不放，小鸟都会直接掉下来摔死，所以咱们只能不停的戳。各位能感受到操作的简单了吧，可就是这么简单的操作，却让人蛋疼不已，在飞行的前方有很多障碍树桩，玩家需要控制小鸟从中间飞过，必须要精确的控制点触屏幕的时间，早了、晚了、快了、慢了都不行，直接把神操坑到了手残的地步。','2014-05-08 03:01:31','com.seriouscorp.clumsybird.apk',3291903,90000095,5,14,0,'扑扇的小鸟','','','com.seriouscorp.clumsybird',1,NULL,306,3,1,NULL,NULL,'psdxn',0,3),('1.0.8','《方块猫养不停》是一款萌系风格的养成游戏。方块猫，是拥有地球猫习性但身体却像果冻般的奇妙宇宙方块生物。为了进一步研究电波与方块猫成长之间的关联性，这一次特地先在地球的小型研究所里进行养育的工作。《方块猫养不停》中除了有各种独特的食物以外，当然也准备了各种方块猫们最喜欢的看的电视节目。就请受邀的各位一边学习照顾方块猫，一边期待互动过程中发生的惊奇事件吧！\n【游戏特色】 \n- 风格独特：全宇宙独一无二养育外星猫咪的题材！ \n- 可爱疗愈：所有的东西都是颜色缤纷又可爱，让方块猫们融化你的心吧～ \n- 操作简单：接口直觉，用一只手指头就能搞定所有养育的大小事！ \n- 造型丰富：超过20种的方块猫专属食物、玩具及合成素材！超充实的内容等你来体验～ \n- 好友交流：除了经常清理自己的猫砂盆外，拜访朋友的房间也能有意外收获喔～ \n- 独特内涵：方块猫的成长变化、体色和他所看的电视节目内容和吃的东西息息相关！\n请一边推敲方块猫所留下的讯息，一边享受这个奇妙的游戏世界吧～','2014-05-08 03:01:35','air.tw.com.enjoyplay.app02.apk',16525650,1000008,8,14,0,'方块猫养不停','CatsBlock Land ','','air.tw.com.enjoyplay.app02',1,NULL,307,0,1,NULL,NULL,'fkmybt',0,2),('2.0.2','注：此游戏需要遥控器或鼠标先进行设置和开始游戏按钮的点击\n\n《波斯王子：影与火 Prince of Persia Shadow&amp;amp;Flame》是一款由育碧出品的经典动作游戏。传奇平台动作游戏重生，具有重新设计的全新视觉效果和操控方式，完全契合您的设备。继《波斯王子经典版》之后，《波斯王子：影与火》将延续流浪王子的传奇故事。现在，他必须踏上史诗旅程，追寻他的过去，改变他的未来！令人身临其境的单人游戏体验。 \n【游戏特点】 \n- 传承原版游戏的宏伟故事情节。 \n- 拥有14个完全3D化的关卡。 \n- 拥有5种不同艺术风格的场景。 \n- 全新的战斗系统 \n- 探索令人兴奋的全新战斗系统，同时应对多个敌人，挑战你的策略思想。 \n- 释放毁灭性的连击绝招，并在升级解锁威力更强的招式。 \n- 搜集新武器，以应对更加惊险的战斗。 \n- 专为触摸屏设计的直观操作方式 \n- 体验广受好评的《波斯王子》平台动作游戏玩法。 \n- 可选择手势触控方式或经典虚拟案件操控。 \n- 施展流畅的特技动作克服挑战，或谨慎地进行游戏。 \n【关于修改】 \n游戏修改了金币为9999999.','2014-05-08 03:01:35','com.ubisoft.princeofpersia.shadowandflame.ggp.apk',43969287,5,9,17,0,'波斯王子：影与火','Prince of Persia Shadow&Flame','','com.ubisoft.princeofpersia.shadowandflame.ggp',1,NULL,308,510,1,NULL,NULL,'bswzyyh',0,4),('1.0.2','番茄视频，为电视盒子和智能电视的用户服务的视频聚合应用。\n1、最全视频：全网几十万部的电影、电视剧、综艺、动漫视频，每天第一时间更新最热影视剧；\n2、高清直播：提供丰富的直播资源，包括央视、热门省级卫视、凤凰卫视等；\n3、优质内容：新闻、广场舞、音乐、纪录片、相声小品、时尚生活、公开课等精彩短视频推荐；\n4、便捷操作：懂你的交互设计和清新的界面，专为智能电视、盒子设计，轻松应对遥控器。 \n\n尚在测试阶段，欢迎随时交流，每一个反馈对我们都非常重要。','2014-05-08 03:01:35','com.fanqie.tvbox.apk',7405036,102,13,17,0,'番茄视频','','首页增加轮播功能，播放每日新闻头条 & 优质预告片。\n修改电视剧最后一集播放完毕提示错误的问题\n修改播放失败后循环切换视频源问题\n修改部分盒子上首次点击暂停闪一下的问题\n修复部分Crash问题\n稳定播放适配更多机型\n','com.fanqie.tvbox',1,NULL,309,0,1,NULL,NULL,'fqsp',0,3),('3.7','搜狐新闻客户端是现在最流行的新闻类app，是央视新闻独家合作伙伴。海量媒体账号等您关注，免费独家资源任您阅读。每天上班、下班、睡前用手机要做的三件事：刷微博、聊微信、看搜狐新闻客户端。\n★搜狐新闻为您展现全媒体新闻形式，多角度了解新闻热点★\n\n★“搜狐新闻客户端”是搜狐网为android用户量身打造的免费新闻资讯类软件，在这里您随时随地方便快捷了解最新最热的实时新闻, 集报刊订阅、自媒体与要闻、微博、体育、直播、娱乐、视频、财经、IT、军事、汽车、星座、读书、微闻、组图等频道于一体, 真正体验到“搜狐新闻，先知道”。','2014-05-08 03:01:35','com.sohu.newsclient.apk',6062172,62,5,0,0,'搜狐新闻','','频道编辑交互优化，操作更方便；\n修复多项bug，使用更流畅。','com.sohu.newsclient',1,NULL,310,26,1,NULL,NULL,'shxw',0,1),('1.0.6','赖子麻将简介 ★★不用注册，直接联网游戏。\n★★原汁原味，地道的武汉规则。\n★★炫酷华丽，不一般的效果体验。\n★★支持单机，没有网络照样玩。\n\n\n武汉赖子麻将的规则体系发展历史源远流长，其中规则经过了很多的变化，\n目前流行的主要规则便是两大派系：红中发财杠和七皮四赖红中杠。\n两种规则，打发简单、变化无穷、节奏快速。\n武汉赖子麻将最大的特点是算番复杂,输赢额度很大,特别考验玩家的计算能力。','2014-05-08 03:01:37','com.bf.laizimj.apk',13579741,