('1.0.3 duokan.amlogic.zh_CN ','Android 版植物大战僵尸在亚马逊软件商店正式首发了，并且享有两周时间的独家代理权。\n\n《植物大战僵尸》是一款极富策略性的小游戏，可怕的僵尸即将入侵，唯一的防御方式就是栽种植物。此游戏集成了即时战略、塔防御战和卡片收集等要素、游戏的内容就是：玩家控制植物，抵御僵尸的进攻，保护这片草坪。\n\n作为一款小游戏，它成功地借鉴了一些战略游戏的要素——采集资源并利用资源建造其它单位。甚至有一些玩家在拿星际的战略往这款游戏中套用，以阐述这款游戏需要在何时发展\"经济\"，何时发展\"兵力\"。游戏中可以选用的植物有40多种，而每个场景最多只能选用10种植物，这就需要玩家根据自己的游戏策略来作出取舍。\n\n游戏特点：\n\n独特的五种游戏模式：冒险，迷你，益智，生存，花园。多达50个的冒险模式关卡设定，从白天到夜晚，从房顶到游泳池，场景变化多样。\n游戏共有26种不同的僵尸敌人，包括开着车子的雪撬车僵尸和投石机僵尸等，使游戏更具挑战性。\n49种功能强大，互不相同的植物，并可收集硬币购买蜗牛等多种道具。\n打开图鉴，可以看到植物与僵尸的详细介绍。通过\"疯狂戴夫店\"购买特殊植物和工具，以你能想象得到的方式干掉僵尸。\n精致的游戏画面与声音，同时还更新有奖励型的音乐与视频。\n无限次重玩，不会经历两次同样的事件。','2014-05-08 03:08:15','com.trans.pvz.apk',10873334,11,7,0,0,'植物大战僵尸TV版','','','com.trans.pvz',1,NULL,458,0,1,NULL,NULL,'zwdzjstvb',0,5),('1.2.5','法宝顾问是一款全面聚焦法制新闻，整合法律热点的生活应用，让您足不出户就能掌握最新时讯。\n法宝网的专业律师为您提供7×24小时的咨询服务，做您身边的法律顾问。','2014-05-08 03:08:17','com.smarter.fabaov2.apk',12284780,26,14,0,0,'法宝顾问','','','com.smarter.fabaov2',1,NULL,459,0,1,NULL,NULL,'fbgw',0,3),('1.0','《坦克大战》（Battle City）是1985年日本南梦宫Namco游戏公司在任天堂FC平台上，推出的一款多方位平面射击游戏。游戏以坦克战斗及保卫基地为主题，属于策略型联机类。同时也是FC平台上少有的内建关卡编辑器的几个游戏之一，玩家可自己创建独特的关卡，并通过获取一些道具使坦克和基地得到强化。\n\n《坦克大战》的前身是1980年在8位MSX机上发行的《坦克营》（Tank Battalion）。游戏支持2名玩家同时进行战斗，并附加有任务编辑器，可以任意创建关卡。每关需要在复杂的地形上摧毁20辆敌人坦克车辆才能通过，如果玩家的坦克被摧毁多次或己方基地被毁即算任务失败。','2014-05-08 03:08:20','com.jimu.emu.nes.battlecity.box.apk',2420749,1,11,19,0,'坦克大战','','','com.jimu.emu.nes.battlecity.box',1,NULL,460,0,1,NULL,NULL,'tkdz',0,4),('3.06','波克麻将是波克城市面向智能电视平台深度定制的一款麻将游戏集合，内含《国标麻将》、《新连庄麻将》多种特色玩法。游戏打法简单、牌型丰富、刺激好玩，拥智能听牌系统、眼牌功能，及智能出牌提示。游戏支持按键遥控、空鼠操作，针对电视平台进行专门操作优化，给您最佳的电视游戏体验。\n\n游戏特点\n1、全新游戏界面，全“心”体验\n独有波克UI风格，功能丰富更人性化，让你从“心”体验！\n2、3D画面，炫目特效\n超清3D画面，十余种动画特效激发无穷战意！\n3、国标玩法，牌型丰富\n国标玩法，牌型更丰富，增加趣味性！\n4、连庄打法，惊喜连连\n当成为庄家并连庄胡牌，连庄胡牌更有通关奖励！\n5、趣味小游戏，惊喜“翻”出来\n全新翻翻看小游戏，6连庄通关即可进入，翻牌闯关赢元宝！','2014-05-08 03:08:20','com.pokercity.mjtv.apk',16012291,10000,8,0,0,'波克麻将','','优化用户体验','com.pokercity.mjtv',1,NULL,461,339,1,NULL,NULL,'bkmj',0,4),('1.25','天龙帝国201年夏，位于帝国北方的兽人联合地精，矮人两族撕毁了70年前的和平条约。悄然发动了一次规模空前的全面战争。帝国在长期的和平下早已失去