双方要尽快将手中的牌出完。当一方将牌出完，而另外一方的两家都没有出完，则叫双扣成功了。\r\n千变双扣是在火拼双扣（即百变双扣）游戏的基础上发展而来的。牌型更加丰富，游戏的过程中牌局变化更多，积分的奖励更加多样和刺激。\r\n千变双扣和火拼双扣的区别不大，主要体现在：\r\n1、小王也可当财神，可以充当扑克牌中任何一张牌。\r\n2、连炸，实现了连炸不用筹牌数，例，3333 44444 555555 也可以当三连炸出牌。\r\n3、手中牌贡献分按最大计算，大王、小王在手中，系统会自动按照哪种排列形成的贡献分最大计算。\r\n \r\n不久，边锋集团边锋无线团队将陆续为您带来欢乐双扣，火拼双扣（百变双扣），杭州双扣，温州双扣等。\r\n \r\n                            ','2014-05-08 03:08:46','com.shuangkouHD.apk',19159749,211,7,8,0,'千变双扣 ','None','None','com.shuangkouHD',1,NULL,480,124,1,NULL,NULL,'qbsk',0,3),('1.2.3.3','\r\n                            风行Android版致力于打造免费、高品质、海量的在线影视点播软件，它依托风行网的影视资源优势，为用户提供世界各地最全面的影视资源片源多：电影电视剧储备最多的播放软件，全球电影、电视剧、大片、动漫综艺一网打尽。更新快：每日更新，同步各大卫视，热片、大片第一时间观看; 播放流畅：采用最先进的影片压制和传输技术，播放更流畅; 集成VLC多媒体播放器，解决系统播放器无法观看影片的问题，支持市场上大部分机型，可尽情畅享风行海量高清影视。\r\n                            ','2014-05-08 03:08:46','com.funshion.video.apk',11311773,204,5,0,0,'风行HD','None','修复已知问题\n优化程序架构，运行更稳定','com.funshion.video',1,NULL,481,58,1,NULL,NULL,'fxhd',0,2),('1.3.0','RUI电视桌面，让智能电视更出彩！\n\n海内外数百电视频道，电视直播、回播；\n海量电影电视资源，高清、超清点播；\n\n专为安卓电视、电视盒子设计的桌面启动器；\n全新界面，美化升级，符合TV用户使用习惯！\n\n英菲克、小米、乐视、开博尔、天敏、迈乐、海美迪、杰科、迪优美特、美如画等盒子均完美兼容。\n       专门的IPTV桌面，符合TV使用习惯。软件分类管理，免去查找应用的麻烦。影视，音乐，游戏界面，立体滑动效果，简洁直观。常用网址导航，点击即可打开网页。精品应用尽在桌面，直接下载使用。','2014-05-08 03:08:46','com.uprui.tv.launcher.apk',4271226,1032015,14,17,0,'RUI电视桌面','','功能特点：\n新UI,新体验，让你爱不释手，精彩一步到位！\n增加天气时钟，查看天气一步到位；\n获取精彩推荐，下载安装一步到位；\n分屏显示媒体，观影娱乐一步到位；\n应用智能分类，查找应用一步到位。','com.uprui.tv.launcher',1,NULL,482,83,1,NULL,NULL,'ruidszm',0,3),('1.1.8','一款扣人心弦，场面火爆的赛车游戏。在这款快速而令人爽透的投币式街机风格的赛车游戏中，你要在拥有美丽而现实的3D环境的不同赛道上对抗你的朋友或PC对手。\n\n游戏上手容易，但拥有难度递增和解锁模式的特征，以及一个动态的游戏世界。雷电风暴中的玩家可以控制某些这个世界上最为顶极的力量型赛车，多变的赛道，决定拟真的游戏环境，活泼的画面，灵敏的控制还有丰富的细节画面使得这款游戏让普通游戏迷和老鸟们都爱不释手。\n\n升级赛车和解锁出10条不同的赛道，如跳跃型赛道、隧道和坑凹的赛道等。\n\n每次竞赛之间可定制你的赛车，购买新的引擎、轮胎。\n\n可以使用触屏与重力两种方式控制赛车，刚开始时可能难以驾驭，待上手后操作感还是不错的。游戏还支持局域内对战、网上对战两种对战方式，玩家可以与好友尽情驰骋竞技。','2014-05-08 03:08:46','com.polarbit.rthunderlite.apk',5185724,118,3,14,0,'雷霆赛车 ','Raging Thunder','None','com.polarbit.rthunderlite',1,NULL,483,467,1,NULL,NULL,'lt